html {

}

body, canvas, div {
  display: block;
  outline: none;

  user-select: none;
  -moz-user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -khtml-user-select: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);

/* Remove spin of input type number */
input::-webkit-outer-spin-button,
input::-webkit-inner-spin-button {
  /* display: none; <- Crashes Chrome on hover */
  -webkit-appearance: none;
  margin: 0; /* <-- Apparently some margin are still there even though it's hidden */
}

body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;
  border: 0;
  margin: 0;

  cursor: default;
  color: #888;
  background-color: #333;

  text-align: center;
  font-family: Helvetica, Verdana, Arial, sans-serif;

  display: flex;
  flex-direction: column;
  
  /* fix bug: https://github.com/cocos-creator/2d-tasks/issues/791 */
  /* overflow cannot be applied in Cocos2dGameContainer, 
  otherwise child elements will be hidden when Cocos2dGameContainer rotated 90 deg */
  overflow: hidden;
}

#Cocos2dGameContainer {
  position: absolute;
  margin: 0;
  left: 0px;
  top: 0px;

  display: -webkit-box;

  -webkit-box-pack: center;
}

canvas {
  background-color: rgba(0, 0, 0, 0);
}

a:link, a:visited {

}

a:active, a:hover {

}

}

p.footer {

.progress-bar {
    position: absolute;
    left: 27.5%;
    top: 80%;
    height: 3px;
    padding: 2px;
    width: 45%;
    border-radius: 7px;
    box-shadow: 0 1px 5px #000 inset, 0 1px 0 #444;           
}

.progress-bar span {
    display: block;
    height: 100%;
    border-radius: 3px;
    transition: width .4s ease-in-out;
    background-color: #3dc5de;
}

.stripes span {
    background-size: 30px 30px;
    background-image: linear-gradient(135deg, rgba(255, 255, 255, .15) 25%, transparent 25%,
                        transparent 50%, rgba(255, 255, 255, .15) 50%, rgba(255, 255, 255, .15) 75%,
                        transparent 75%, transparent);            
    
    animation: animate-stripes 1s linear infinite;             
}

@keyframes animate-stripes {
    0% {background-position: 0 0;} 100% {background-position: 60px 0;}
}

</style>

<script charset="utf-8">
function boot() {

    var settings = window._CCSettings;
    window._CCSettings = undefined;
    var onProgress = null;

    let { RESOURCES, INTERNAL, MAIN, START_SCENE } = cc.AssetManager.BuiltinBundleName;
    function setLoadingDisplay() {
        // Loading splash scene
        var splash = document.getElementById('splash');
        var progressBar = splash.querySelector('.progress-bar span');
        onProgress = function (finish, total) {
            var percent = 100 * finish / total;
            if (progressBar) {
                progressBar.style.width = percent.toFixed(2) + '%';
            }
        };
        splash.style.display = 'block';
        progressBar.style.width = '0%';

        cc.director.once(cc.Director.EVENT_AFTER_SCENE_LAUNCH, function () {
            splash.style.display = 'none';
        });
    }

    var onStart = function () {

        cc.view.enableRetina(true);
        cc.view.resizeWithBrowserSize(true);

        if (cc.sys.isBrowser) {
            setLoadingDisplay();
        }

        if (cc.sys.isMobile) {
            if (settings.orientation === 'landscape') {
                cc.view.setOrientation(cc.macro.ORIENTATION_LANDSCAPE);
            }
            else if (settings.orientation === 'portrait') {
                cc.view.setOrientation(cc.macro.ORIENTATION_PORTRAIT);
            }
            // cc.view.enableAutoFullScreen([
            //     cc.sys.BROWSER_TYPE_BAIDU,
            //     cc.sys.BROWSER_TYPE_BAIDU_APP,
            //     cc.sys.BROWSER_TYPE_WECHAT,
            //     cc.sys.BROWSER_TYPE_MOBILE_QQ,
            //     cc.sys.BROWSER_TYPE_MIUI,
            // ].indexOf(cc.sys.browserType) < 0);
        }

        // Limit downloading max concurrent task to 2,
        // more tasks simultaneously may cause performance draw back on some android system / browsers.
        // You can adjust the number based on your own test result, you have to set it before any loading process to take effect.
        if (cc.sys.isBrowser && cc.sys.os === cc.sys.OS_ANDROID) {
            cc.assetManager.downloader.maxConcurrency = 2;
            cc.assetManager.downloader.maxRequestsPerFrame = 2;
        }

        var launchScene = settings.launchScene;
        var bundle = cc.assetManager.bundles.find(function (b) {
            return b.getSceneInfo(launchScene);
        });

        bundle.loadScene(launchScene, null, onProgress,
            function (err, scene) {
                if (!err) {
                    cc.director.runSceneImmediate(scene);
                    if (cc.sys.isBrowser) {
                        // show canvas
                        var canvas = document.getElementById('GameCanvas');
                        canvas.style.visibility = '';
                        var div = document.getElementById('GameDiv');
                        if (div) {
                            div.style.backgroundImage = '';
                        }
                        console.log('Success to load scene: ' + launchScene);
                    }
                }
            }
        );

    };

    var option = {
        id: 'GameCanvas',
        debugMode: settings.debug ? cc.debug.DebugMode.INFO : cc.debug.DebugMode.ERROR,
        showFPS: settings.debug,
        frameRate: 60,
        groupList: settings.groupList,
        collisionMatrix: settings.collisionMatrix,
    };

    cc.assetManager.init({
        bundleVers: settings.bundleVers,
        remoteBundles: settings.remoteBundles,
        server: settings.server
    });

    let bundleRoot = [INTERNAL, MAIN];
    settings.hasStartSceneBundle && bundleRoot.push(START_SCENE);
    settings.hasResourcesBundle && bundleRoot.push(RESOURCES);

    var count = 0;
    function cb(err) {
        if (err) return console.error(err.message, err.stack);
        count++;
        if (count === bundleRoot.length + 1) {
            cc.game.run(option, onStart);
        }
    }

    cc.assetManager.loadScript(settings.jsList.map(function (x) { return 'src/' + x; }), cb);

    for (let i = 0; i < bundleRoot.length; i++) {
        cc.assetManager.loadBundle(bundleRoot[i], cb);
    }
};

!function () {
    if (window.document) {
        // Bundle
        var loadBundle = function (nameOrUrl, options, onComplete) {
            var str = window.resMap[nameOrUrl + '/config.json'];
            str.base = nameOrUrl + '/';
            var data = JSON.parse(str);
            onComplete(null, data);
        };

        // Json
        var loadJson = function (nameOrUrl, options, onComplete) {
            var data = JSON.parse(window.resMap[nameOrUrl]);
            onComplete(null, data);
        }

        // Text || Plist
        var downloadText = function (url, options, onComplete) {
            var data = window.resMap[url];
            onComplete(null, data);
        };

        // Image
        function loadDomImage(url, options, onComplete) {
            var index = url.lastIndexOf(".");
            var strtype = url.substr(index + 1, 4);
            strtype = strtype.toLowerCase();
            var data = window.resMap[url];

            var img = new Image();

            if (window.location.protocol !== 'file:') {
                img.crossOrigin = 'anonymous';
            }

            function loadCallback() {
                img.removeEventListener('load', loadCallback);
                img.removeEventListener('error', errorCallback);
                onComplete && onComplete(null, img);
            }

            function errorCallback() {
                img.removeEventListener('load', loadCallback);
                img.removeEventListener('error', errorCallback);
                onComplete && onComplete(new Error(cc.debug.getError(4930, url)));
            }

            img.addEventListener('load', loadCallback);
            img.addEventListener('error', errorCallback);
            img.src = data;
            return img;
        }

        var loadImage = function (nameOrUrl, options, onComplete) {
            loadDomImage(nameOrUrl, options, onComplete);
        }

        // Audio
        var __audioSupport = cc.sys.__audioSupport;
        var formatSupport = __audioSupport.format;
        var context = __audioSupport.context;

        function base64toBlob(base64, type) {
            var bstr = atob(base64, type),
                n = bstr.length,
                u8arr = new Uint8Array(n);
            while (n--) {
                u8arr[n] = bstr.charCodeAt(n)
            }
            return new Blob([u8arr], {
                type: type,
            })
        }

        function base64toArray(base64) {
            var bstr = atob(base64),
                n = bstr.length,
                u8arr = new Uint8Array(n);
            while (n--) {
                u8arr[n] = bstr.charCodeAt(n)
            }

            return u8arr;
        }

        function loadDomAudio(url, onComplete) {

            var dom = document.createElement('audio');

            dom.muted = true;
            dom.muted = false;

            var data = window.resMap[url.split("?")[0]];
            data = base64toBlob(data, "audio/mpeg");

            if (window.URL) {
                dom.src = window.URL.createObjectURL(data);
            } else {
                dom.src = data;
            }

            var clearEvent = function () {
                clearTimeout(timer);
                dom.removeEventListener("canplaythrough", success, false);
                dom.removeEventListener("error", failure, false);
                if (__audioSupport.USE_LOADER_EVENT)
                    dom.removeEventListener(__audioSupport.USE_LOADER_EVENT, success, false);
            };

            var timer = setTimeout(function () {
                if (dom.readyState === 0)
                    failure();
                else
                    success();
            }, 8000);

            var success = function () {
                clearEvent();
                onComplete && onComplete(null, dom);
            };

            var failure = function () {
                clearEvent();
                var message = 'load audio failure - ' + url;
                cc.log(message);
                onComplete && onComplete(new Error(message));
            };

            dom.addEventListener("canplaythrough", success, false);
            dom.addEventListener("error", failure, false);
            if (__audioSupport.USE_LOADER_EVENT)
                dom.addEventListener(__audioSupport.USE_LOADER_EVENT, success, false);
            return dom;
        }

        function loadWebAudio(url, onComplete) {
            if (!context) callback(new Error('Audio Downloader: no web audio context.'));

            var data = window.resMap[url];
            data = base64toArray(data);

            if (data) {
                context["decodeAudioData"](data.buffer, function (buffer) {
                    onComplete(null, buffer);
                }, function () {
                    onComplete('decode error - ' + url, null);
                });
            } else {
                onComplete('request error - ' + url, null);
            }
        }

        var loadAudio = (url, options, onComplete) => {
            if (formatSupport.length === 0) {
                return new Error('Audio Downloader: audio not supported on this browser!');
            }

            // If WebAudio is not supported, load using DOM mode
            if (!__audioSupport.WEB_AUDIO) {
                loadDomAudio(url, onComplete);
            }
            else {
                loadWebAudio(url, onComplete);
            }
        }

        // Font
        var loadFont = (url, options, onComplete) => {
            var ttfIndex = url.lastIndexOf(".ttf");

            var slashPos = url.lastIndexOf("/");
            var fontFamilyName;
            if (slashPos === -1) {
                fontFamilyName = url.substring(0, ttfIndex) + "_LABEL";
            } else {
                fontFamilyName = url.substring(slashPos + 1, ttfIndex) + "_LABEL";
            }
            if (fontFamilyName.indexOf(' ') !== -1) {
                fontFamilyName = '"' + fontFamilyName + '"';
            }

            // Setup font face style
            let fontStyle = document.createElement("style");
            fontStyle.type = "text/css";
            let fontStr = "";
            if (isNaN(fontFamilyName - 0))
                fontStr += "@font-face { font-family:" + fontFamilyName + "; src:";
            else
                fontStr += "@font-face { font-family:'" + fontFamilyName + "'; src:";

            var data = "url(data:application/x-font-woff;charset=utf-8;base64,PASTE-BASE64-HERE) format(\"woff\");";
            data = data.replace("PASTE-BASE64-HERE", window.resMap[url]);

            fontStr += data;
            fontStyle.textContent = fontStr + "}";
            document.body.appendChild(fontStyle);

            // Preload font with div
            let preloadDiv = document.createElement("div");
            let divStyle = preloadDiv.style;
            divStyle.fontFamily = fontFamilyName;
            preloadDiv.innerHTML = ".";
            divStyle.position = "absolute";
            divStyle.left = "-100px";
            divStyle.top = "-100px";
            document.body.appendChild(preloadDiv);

            onComplete(null, fontFamilyName);
        }

        // Binary
        function loadBinary(url, options, onComplete) {
            var data = window.resMap[url].replace('data:application/octet-stream;base64,', '');
            data = base64toArray(data);
            onComplete(null, data);
        }

        // Video
        var loadVideo = (url, options, onComplete) => {
            var data = window.resMap[url];
            onComplete(null, data);
        }

        cc.assetManager.downloader.register('bundle', loadBundle);
        cc.assetManager.downloader.register('.json', loadJson);
        cc.assetManager.downloader.register('.plist', downloadText);
        cc.assetManager.downloader.register('.png', loadImage);
        cc.assetManager.downloader.register('.jpg', loadImage);
        cc.assetManager.downloader.register('.jpeg', loadImage);
        cc.assetManager.downloader.register('.mp3', loadAudio);
        cc.assetManager.downloader.register('.ogg', loadAudio);
        cc.assetManager.downloader.register('.wav', loadAudio);
        cc.assetManager.downloader.register('.m4a', loadAudio);
        cc.assetManager.downloader.register('.mp4', loadVideo);
        cc.assetManager.downloader.register('.ttf', loadFont);
        cc.assetManager.downloader.register('.bin', loadBinary);

        var splash = document.getElementById('splash');
        splash.style.display = 'block';
        cc.macro.CLEANUP_IMAGE_CACHE = false;
    }
}();
</script>
<script charset="utf-8">
window.NETWORK = "applovin";
window.AD_NET = 'apl';
window.SOUND_ON = true;
window.ANALYTICS_ON = false;
window.IS_STANDALONE = true;

const startGame = () => {
    if (startGame.started) return;
    startGame.started = true;


    if(window.Game && !window.cc) {
        Game.init();
        try {
            initListeners();
            mraid.expand();
        } catch (e) {
        } finally {
            LayoutManager.fitLayout();
        }
    } else if(!window.Game && window.cc) {
        window.boot && window.boot();
    }
};

const domReadyHandler = () => {
    window.removeEventListener("load", domReadyHandler);
    startGame();
};

const mraidReadyHandler = () => {
    mraid.removeEventListener("ready", mraidReadyHandler);
    console.log("MRAID ready", window.location.href);
    if (mraid.isViewable()) {
        console.log("MRAID not viewable");
        return mraidViewableHandler(true);
    }
    mraid.addEventListener("viewableChange", mraidViewableHandler);
};

const mraidViewableHandler = (flag) => {
    if (!startGame.started && flag) {
        console.log("MRAID viewable", window.location.href);
        mraid.removeEventListener("viewableChange", mraidViewableHandler);
        startGame();
    }

    if(window.cc) {
        if (flag) {
            window.cc.director.resume();
            if (window.cc.audioEngine !== undefined) {
                window.cc.audioEngine.resumeMusic();
                window.cc.audioEngine.resumeAllEffects();
            }
        } else {
            window.cc.director.pause();
            if (window.cc.audioEngine !== undefined) {
                window.cc.audioEngine.pauseMusic();
                window.cc.audioEngine.pauseAllEffects()
            }
        }
    }
};

const initListeners = () => {
    window.addEventListener("resize", LayoutManager.fitLayout);
    setInterval(LayoutManager.fitLayout, 100);

    mraid.addEventListener("stateChange", (state) => {
        if (state === "expanded") {
            startGame();
            LayoutManager.fitLayout();
        }
    });
    mraid.addEventListener("sizeChange", () => {
        console.log("MRAID sizeChange", arguments);
        LayoutManager.fitLayout();
    });
    mraid.addEventListener("viewableChange", () => {
        console.log("MRAID viewableChange", arguments);
        LayoutManager.fitLayout();
    });
    mraid.addEventListener("error", () => {
        console.log("MRAID error", arguments);
    });
};

const callSDK = (e) => {
    if (e === "download") {
        let userAgent = navigator.userAgent || navigator.vendor;
        let url = CONFIG.appStoreUrl;
        if (/android/i.test(userAgent)) {
            url = CONFIG.playStoreUrl;
        }

        if (typeof mraid !== "undefined") {
            mraid.open(url)
        } else {
            window.open(url)
        }
    }

    Game.emit('callSDK', e);
};

const redirect = ()=> {
    if (window.REDIRECT_URL) {
        if (typeof mraid !== "undefined") {
            mraid.open(window.REDIRECT_URL)
        } else {
            window.open(window.REDIRECT_URL)
        }
    }
    console.log('redirect')
}

try {
    if (mraid.getState() === "loading") {
        mraid.addEventListener("ready", mraidReadyHandler);
    } else {
        mraidReadyHandler();
    }
} catch (e) {
    if (e.name === "ReferenceError") {
        // mraid is not defined
        window.addEventListener("load", domReadyHandler);
    }
}
</script>
